import React from "react";

function NavBar(props) {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <span className="navbar-brand mb-0 h6">DC Comic Super Heros</span>
      <ul className="navbar-nav">
        <li className="nav-link" className="navbar-nav mb-0 h6 buttonColors">
          <a href="#">Home</a>
        </li>
        <li className="nav-link" className="navbar-nav mb-0 h6">
          <a href="#">About Us</a>
        </li>
        <li className="nav-link" className="navbar-nav mb-0 h6">
          <a href="#">Contact Us</a>
        </li>
      </ul>
      <button className="btn btn-dark" onClick={props.click}>
        Add another DC comic super hero
      </button>
    </nav>
  );
}

export default NavBar;
